import{_ as e,o as i,c as t,e as a}from"./app-93907a86.js";const r={},l=a('<h1 id="_1-软件概述" tabindex="-1"><a class="header-anchor" href="#_1-软件概述" aria-hidden="true">#</a> 1.软件概述</h1><p>AI Matrix是由嘉楠科技开发的一款通用视觉AI计算平台，该平台能够帮助用户迅速训练AI模型，同时可以将训练完毕的模型轻松部署到嘉楠芯片中，如k210,、k510等。使用该平台能够以零代码成本实现数据集拆分、数据集分布预览、模型训练评估及模型部署。</p><p>嘉楠科技成立于2013年，致力于人工智能芯片研发。2016年实现了16nm芯片的量产，2018年实现量产全球首款自主知识产权的7nm芯片，以及量产全球首款基于RISC-V架构自主知识产权商用边缘AI芯片。同时嘉楠科技已使用AI技术对多个下游行业进行了赋能，如AI医疗、新零售、智慧交通、AI农业等。</p><p>嘉楠科技推出的AI Matrix通用视觉检测平台以深度学习技术为依托，将人工智能技术与高性能计算技术应用于端侧设备的部署当中。从而缩短任务端开发周期，为产业下游的高速生产提供平台化支持。</p><p>AI Matrix由以下几部分组成，如图1-1所示。</p><ol><li>数据解析模块（支持不同格式数据集）</li><li>模型训练（提供通用训练范式）</li><li>多任务支持（图像分类、目标检测、语义分割）</li><li>内置预训练网络</li><li>芯片部署资源包</li><li>PC模型验证及芯片推理支持</li></ol><p><img src="http://photos.100ask.net/canaan-docs/image-20240522180021047.png" alt="image-20240522180021047"></p><p>图1-1 AI Matrix组成结构</p>',8),c=[l];function n(o,s){return i(),t("div",null,c)}const _=e(r,[["render",n],["__file","01-AIMatrixOverview.html.vue"]]);export{_ as default};
